function f(a,o,s){let c=null,i=1/0;return s.forEach(t=>{if(!t.location)return;const n=h(a,o,t.location.lat,t.location.lon);n<i&&(i=n,c=t)}),c}function h(a,o,s,c){const t=(s-a)*(Math.PI/180),n=(c-o)*(Math.PI/180),e=Math.sin(t/2)*Math.sin(t/2)+Math.cos(a*(Math.PI/180))*Math.cos(s*(Math.PI/180))*Math.sin(n/2)*Math.sin(n/2);return 6371*(2*Math.atan2(Math.sqrt(e),Math.sqrt(1-e)))}export{f};
